  \"2016-05-26T07:07:06.343124\",\n\t\"name\": \"parking-spaces-at-off-street-parking-facilities\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"This dataset identifies the location and
  number of parking spaces at off-street parking facilities with publicly available
  parking in order to support good parking management policies. Data was created through
  the manual addition of points and attributes in a GIS system. Data originally sourced
  from the Registered Businesses in SF published by the SF Treasurer's office https://data.sfgov.org/Economy-and-Community/Registered-Business-Locations-San-Francisco/g8m3-pdis.
  Additional field work conducted in 2009-2013 to verify, correct, and augment the
  Treasurer's office registered businesses database. Full documentation found here:
  http://sfpark.org/resources/parking-census-map-april-2014/ The data is updated infrequently.
  SFMTA owned garage attributes are updated approximately twice a year. Note: Count
  of spaces found in the \"RegCap\" field (\"regular capacity\")\",\n\t\"license_title\":
